INSERT INTO `board` VALUES (1,'notice','DreamLand 개장 안내','<p>드디어, 개장합니다.</p><p>대환영??</p><p><br></p><p><br></p>','2022-10-11 14:40:58'),(2,'faq','위치 안내','<p>장소는 여<span style=\"background-color: rgb(255, 255, 0);\">기입니다.</span></p>','2022-10-11 14:41:48'),(3,'notice','운영시간 안내','<p>안녕하세요.</p><p><span style=\"background-color: rgb(255, 255, 0);\">오전 9시 ~ 23시까지 </span>운영합니다.</p><p><br></p>','2022-10-11 16:28:26'),(4,'notice','코로나 관련 안내','<p>실내 기구 탑승 시에는 마스크 착용 필수입니다.</p><p><img style=\"width: 25%;\" src=\"data:image/jpeg;base64,\" data-filename=\"loopy06.jpg\"><br></p><p><b><u><span style=\"font-family: &quot;Comic Sans MS&quot;; background-color: rgb(255, 239, 198);\">DreamLand</span></u></b>에서 즐거운 시간 보내세요.</p>','2022-10-14 16:11:59'),(5,'faq','단체 문의','<p>안녕하세요.</p><p>DreamLand? 입니다.</p><p>단체 입장을 문의주시는 분들은 1:1문의로 연락처를 남겨주시면&nbsp;</p><p>자세한 안내드리겠습니다.</p><p>오늘도 좋은 하루 보내세요.</p>','2022-11-03 16:05:29'),(6,'faq','입장 티켓 연령대 안내','<p>안녕하세요. <span style=\"background-color: rgb(255, 214, 99); font-family: &quot;Comic Sans MS&quot;;\"><b><u>DreamLand</u></b></span>입니다.</p><p>입장 티켓별 연령대 안내드립니다.</p><p>아동 : 미취학연령 (초등학생 입학 전 영유아, 어린이) 대상</p><p>청소년 : 초등학생 ~ 고등학생 대상</p><p>성인 : 만 19세 이상 성인 대상</p><p><br></p><p><b style=\"font-family: &quot;Comic Sans MS&quot;;\"><u style=\"background-color: rgb(255, 214, 99);\">DreamLand</u></b>에 관심 가져주셔서 감사합니다.?</p>','2022-11-09 09:10:16');
